import React from "react";

const CartPage = ({ cart }) => {
  return (
    <div className="container">
      <h2>Your Cart ðŸ›’</h2>
      {cart.length === 0 ? <p>No items in cart</p> : (
        <ul>
          {cart.map((item, index) => (
            <li key={index}>
              <img src={item.primaryImage} alt={item.name} width="50" />
              {item.name} - {item.currentPrice}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default CartPage;
